import React from 'react';
import {Link, Route, Routes} from 'react-router-dom';
import AllArticles from "./allArticle";
import AddArticle from "./addArticles";
import ArticleDetail from "./articleDetail";
import { useNavigate } from 'react-router-dom';


function Board() {
  return (
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/board/articles">Articles</Link> {/* 상위 경로 /board 추가 */}
            </li>
            <li>
              <Link to="/board/addArticles">Add Article</Link> {/* 상위 경로 /board 추가 */}
            </li>
          </ul>
        </nav>

        {/* 라우트 설정 */}
        <Routes>
          <Route path="/board/articles" element={<AllArticles />} />
          <Route path="/board/articles/:id" element={<ArticleDetail />} />
          <Route path="/board/addArticles" element={<AddArticle />} />
        </Routes>
      </div>
  );
}

export default Board;
